            name: 'Danilo'
        }
    }

    render() {
        return (
            <div className="my-class-from-react">
                <StateInput/>
                <h1> Mais um hello word.</h1>
                <span>{this.state.name}</span>
            </div>
        )
    }
}

export default HelloWord
